!function(n){try{n=angular.module("appViews")}catch(s){n=angular.module("appViews",[])}n.run(["$templateCache",function(n){n.put("/catalog/vw_main.html",'<div class="row padleft-10">\n\n    <div class="col-xs-12 col-sm-6">\n\n        <div class="row lead padtop-5 padbottom-5 text-center">\n            {{item.title}}\n        </div>\n\n        <div class="row main-image text-center fadein fadeout" ng-show="showImage">\n            <img src="{{i.image}}" ng-repeat="i in item.images" ng-show="i.isActive" />\n        </div>\n\n        <div class="row view-large text-center">\n          <div class="txt" ng-click="toggleMainImage()">\n              <i class="fa fa-plus-circle"></i> view large\n          </div>\n        </div>\n\n        <div class="row thumb-images">\n            <div class="thumbs">\n                <div class="tcol tchev" ng-click="prevImage()">\n                    <i class="fa fa-chevron-left"></i>\n                </div>\n                <div class="tcol fadein fadeout" ng-show="showThumb">\n                    <img src="{{item.images[thumbs[0]].image}}" class="timg">\n                </div>\n                <div class="tcol tmid fadein fadeout" ng-show="showThumb">\n                    <img src="{{item.images[thumbs[1]].image}}" class="timg">\n                </div>\n                <div class="tcol fadein fadeout" ng-show="showThumb">\n                    <img src="{{item.images[thumbs[2]].image}}" class="timg">\n                </div>\n                <div class="tcol tchev" ng-click="nextImage()">\n                    <i class="fa fa-chevron-right"></i>\n                </div>\n            </div>\n        </div>\n\n        <div class="row ratings padtop-15 padbottom-15">\n                <div class="icon-wrapper">\n                    <span class="stars" ng-repeat="n in showStars()">\n                        <i class="fa fa-star" ng-class="{\'on\':(n<=aveRatings),\'off\':(n>aveRatings)}"></i>\n                    </span>\n                </div>\n                <span class="small bold">\n                    Overall\n                </span>\n                <span class="small bold" style="float:right;padding-top:3px;">\n                    view all {{reviews.length}} reviews\n                </span>\n        </div>\n\n        <div class="row ratings reviews mbottom-15">\n            <div class="col-sm-6 padtop-10 mbottom-15">\n                <div class="bold">PRO</div>\n                <div class="desc bottom-border">most helpful 4-5 star rating</div>\n                <div class="mtop-10">\n                    <span class="stars" ng-repeat="n in showStars()">\n                        <i class="fa fa-star" ng-class="{\'on\':(n<=proReview.overallRating),\'off\':(n>proReview.overallRating)}"></i>\n                    </span>\n                </div>\n                <div class="title">{{proReview.title}}</div>\n                <div class="desc">{{proReview.review}}</div>\n                <div class="desc mtop-10">\n                    <span style="color:blue">{{proReview.screenName}}</span> {{proReview.datePosted}}\n                </div>\n            </div>\n            <div class="col-sm-6 padtop-10 mbottom-15">\n                <div class="bold">CON</div>\n                <div class="desc bottom-border">most helpful 1-2 star rating</div>\n                <div class="mtop-10">\n                    <span class="stars" ng-repeat="n in showStars()">\n                        <i class="fa fa-star" ng-class="{\'on\':(n<=conReview.overallRating),\'off\':(n>conReview.overallRating)}"></i>\n                    </span>\n                </div>\n                <div class="title">{{conReview.title}}</div>\n                <div class="desc">{{conReview.review}}</div>\n                <div class="desc mtop-10">\n                    <span style="color:blue">{{conReview.screenName}}</span> {{conReview.datePosted}}\n                </div>\n            </div>\n        </div>\n\n    </div>\n\n    <div class="col-xs-12 col-sm-6">\n\n        <div class="row padtop-10 padbottom-10">\n            <span class="lead">{{item.price}}</span>\n            <span class="small">{{item.priceDesc}}</span>\n        </div>\n\n        <div class="row padtop-10 padbottom-10 bordered">\n            <div class="promo" ng-repeat="promo in promos">\n                <i class="fa fa-tag"></i> {{promo}}\n            </div>\n        </div>\n\n        <div class="row padtop-5 padbottom-5">\n            <div class="col-sm-6 qty padtop-5 padbottom-5 text-center">\n                <span class="small mright-25">quantity:</span>\n                <div class="icon-wrapper">\n                    <i class="fa fa-plus-circle act" ng-click="addQty()"></i>\n                </div>\n                <span class="bold mright-5 mleft-5">{{buyQuantity}}</span>\n                <div class="icon-wrapper">\n                    <i class="fa fa-minus-circle act" ng-click="subQty()"></i>\n                </div>\n            </div>\n        </div>\n\n        <div class="row padtop-5 padbottom-5">\n            <div id="pickup-button" class="col-sm-6 padtop-5 padbottom-5" ng-show="showPickupButton">\n                <button type="button" class="btn btn-primary"style="width:100%">PICK UP IN STORE</button>\n                <div class="text-center mtop-5"><span class="small">find in store</span></div>\n            </div>\n            <div id="addcart-button" class="col-sm-6 padtop-5 padbottom-5" ng-show="showCartButton">\n                <button type="button" class="btn btn-danger" style="width:100%">ADD TO CART</button>\n            </div>\n        </div>\n\n        <div class="row padtop-5 padbottom-5">\n            <div class="col-sm-4 border-right padright-10" style="display:inline-block">RETURNS</div>\n            <div class="col-sm-8 small" style="display:inline-block;">Most unopened items in new condition returned within 90 days will receive a refund or exchange.</div>\n        </div>\n\n        <div class="row padtop-5 padbottom-5">\n            <div class="col-sm-4 padtop-5 padbottom-5">\n                <button type="button" class="btn btn-default btn-sm"style="width:100%"><span class="small">ADD TO REGISTRY</span></button>\n            </div>\n            <div class="col-sm-4 padtop-5 padbottom-5">\n                <button type="button" class="btn btn-default btn-sm" style="width:100%"><span class="small">ADD TO LIST</span></button>\n            </div>\n            <div class="col-sm-4 padtop-5 padbottom-5">\n                <button type="button" class="btn btn-default btn-sm" style="width:100%"><span class="small">SHARE</span></button>\n            </div>\n        </div>\n\n        <div class="row padtop-5 padbottom-5">\n            <div class="col-sm-12 padtop-5 padbottom-5">\n                <h2>product Highlights</h2>\n            </div>\n        </div>\n\n        <div class="row padtop-5 padbottom-5">\n            <div class="col-sm-12 padtop-5 padbottom-5">\n                <ul class="highlights">\n                    <li ng-repeat="hl in highlights">\n                        <span ng-bind-html="hl"></span>\n                    </li>\n                </ul>\n            </div>\n        </div>\n\n    </div>\n\n    <div class="clear"></div>\n\n</div>\n')}])}();